import './css/App.css';

function App() {
  return (
    <div>
      <div className="h1 title"> emily tao </div>
      <div className="h2 description"> developer, engineer, architect </div>

<SideNav>
  <Nav id="1">
    <Item>Link 1</Item>
  </Nav>
  <Nav id="2">
    <Item>Link 2</Item>
  </Nav>
  <Nav id="3">
    <Item>Link 3</Item>
  </Nav>
</SideNav>
    </div> 
  );
}

export default App;
